import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { MDBFooter, MDBContainer, MDBIcon, MDBBtn } from 'mdb-react-ui-kit';

const Footer = () => {
  return (
    <MDBFooter className='bg-purple text-center text-white fixed-bottom'>
      <MDBContainer
        className='d-flex justify-content-around align-items-center p-2.5'
        style={{
          backgroundColor: '#6f42c1',
        }}
      >
        <MDBBtn tag='a' color='primary' href='#'>
          <MDBIcon fab icon='facebook-f' className='me-2' />
          Facebook
        </MDBBtn>
        <MDBBtn tag='a' color='danger' href='#'>
          <MDBIcon fab icon='github' className='me-2' />
          Github
        </MDBBtn>
        <MDBBtn tag='a' color='success' href='#'>
          <MDBIcon fab icon='linkedin' className='me-2' />
          LinkedIn
        </MDBBtn>
      </MDBContainer>
    </MDBFooter>
  );
};

export default Footer;
